import React from "react";

export default function signup() {
  var bg = "./images/church-dome-sunset-light.jpg";
  return (
    <div
      style={{
        backgroundImage: ` linear-gradient(rgb(15 69 29 / 83%), rgb(0 0 0 / 78%)), url(${bg})`,
        height: 600,
        objectFit: "contain",
        width: 500,
      }}
    >
      <div className="signup">
        <div className="container">
          <div className="row"></div>
        </div>
      </div>
    </div>
  );
}
